Wallpapers wallpapersFromJson(String str) => Wallpapers.fromJson(json.decode(str));
String wallpapersToJson(Wallpapers data) => json.encode(data.toJson());
class Wallpapers {
  Wallpapers({
      int? page, 
      int? perPage, 
      List<Photos>? photos, 
      int? totalResults, 
      String? nextPage, 
      String? prevPage,}){
    _page = page;
    _perPage = perPage;
    _photos = photos;
    _totalResults = totalResults;
    _nextPage = nextPage;
    _prevPage = prevPage;
}

  Wallpapers.fromJson(dynamic json) {
    _page = json['page'];
    _perPage = json['per_page'];
    if (json['photos'] != null) {
      _photos = [];
      json['photos'].forEach((v) {
        _photos?.add(Photos.fromJson(v));
      });
    }
    _totalResults = json['total_results'];
    _nextPage = json['next_page'];
    _prevPage = json['prev_page'];
  }
  int? _page;
  int? _perPage;
  List<Photos>? _photos;
  int? _totalResults;
  String? _nextPage;
  String? _prevPage;

  int? get page => _page;
  int? get perPage => _perPage;
  List<Photos>? get photos => _photos;
  int? get totalResults => _totalResults;
  String? get nextPage => _nextPage;
  String? get prevPage => _prevPage;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['page'] = _page;
    map['per_page'] = _perPage;
    if (_photos != null) {
      map['photos'] = _photos?.map((v) => v.toJson()).toList();
    }
    map['total_results'] = _totalResults;
    map['next_page'] = _nextPage;
    map['prev_page'] = _prevPage;
    return map;
  }

